import React, { Component } from 'react'
import Cards from './Cards'
import CardInput from './CardInput'

class CardContainer extends Component {
  render(){
    return(
    <div>
      <div className="card-input">
        <CardInput/>
      </div>
      <h3>Code Logs</h3>
      <Cards/>
    </div>
    )
  }
}


export default CardContainer
